import React from 'react'
import { useState } from 'react';
import './SignUp.css'
export default function SignUp() {


    const [passwordType, setPasswordType] = useState("password");
    const [passwordInput, setPasswordInput] = useState("");
    const handlePasswordChange = (evnt) => {
        setPasswordInput(evnt.target.value);
    }




    const togglePassword = (e) => {
        e.preventDefault()


        if (passwordType === "password") {
            setPasswordType("text")
            return;
        }
        setPasswordType("password")
    }


    const signUp = (e) => {
        e.preventDefault()
        try {
        } catch (error) {
            console.log(error.message)
        }
    }




    return (
        <div>
            <div className='container'>
                <div className="row">
                    <div className="col md-12 sm-12">
                        <div className="LogInCard  ">
                            <div className="card " style={{ width: '20rem', height: "33rem", }}>
                                <div class="card-body">
                                    <h3 class="card-title text-center fw-bold mt-3">Sign Up</h3>
                                    <form>
                                        <div class="mb-3 mt-4">
                                            <label for="exampleInputEmail1" className="form-label mb-0">
                                                Useremail</label>
                                            <input type="email" className="form-control mt-0 userName" placeholder='Type your useremail' />
                                        </div>
                    
                                        <div className="mb-3">
                                            <label for="exampleInputPassword1" className="form-label mb-0" >Password</label>
                    
                                            <i class="bi bi-eye icon"></i>                        <input type="password" className="form-control password" id='password' placeholder='Password' />
                                            <i class="bi bi-eye-slash" className='ayeIcon' id="togglePassword"></i>
                                        </div>
                                        <div className="mb-3">
                                            <label for="exampleInputPassword1" className="form-label mb-0" >Conferm Password</label>
                                            <i className="bi bi-eye-slash" />  <input type={passwordType} onChange={handlePasswordChange} value={passwordInput} name="password" className="form-control password" placeholder="Password" />
                                            <div className="input-group-btn">
                                                {/* <button className="btn btn-outline-primary btn" onClick={togglePassword}>
                                                    {passwordType === "password" ? <i className="bi bi-eye-slash   eysIcon  "></i> : <i className="bi bi-eye"></i>}
                                                </button> */}
                                            </div>
                                        </div>






                                        <div class="form-check form-check-inline">
                                            <input class="form-check-input" type="radio" name="inlineRadioOptions" id="inlineRadio1" value="option1" />
                                            <label class="form-check-label" for="inlineRadio1">Male</label>
                                        </div>

                                        <div class="form-check form-check-inline">
                                            <input class="form-check-input" type="radio" name="inlineRadioOptions" id="inlineRadio2" value="option2" />
                                            <label class="form-check-label" for="inlineRadio2">Female</label>
                                        </div>

                                        <div class="form-check form-check-inline">
                                            <input class="form-check-input" type="radio" name="inlineRadioOptions" id="inlineRadio3" value="option3" />
                                            <label class="form-check-label" for="inlineRadio3">Other</label>
                                        </div>
                                        <div className=''>
                                            <button type="submit" className="btn logInBtn  mt-3 w-100 text-light" onClick={signUp}>Sign Up</button>
                                        </div>
                                    </form>
                                    {/* onClick={(e) => { this.signUpHandle(e) }} */}

                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </div>


    )
}
